import { makeStyles } from "@material-ui/core";

export const useStyles = makeStyles((theme) => ({
  root: {
    paddingTop: theme.spacing(8),
  },
  carousel: {
    position: "relative",
    overflow: "visible",
  },
  movieGroup: {
    height: "896px",
    [theme.breakpoints.down("xs")]: {
      height: "auto",
    },
  },
  navButton: {
    fontSize: "50px",
    color: theme.palette.grey[500],
  },
  paper: {
    padding: "2px 4px",
    display: "flex",
    alignItems: "center",
    width: "300px",
  },
  inputBase: {
    marginLeft: theme.spacing(1),
    flex: 1,
  },
  iconSearch: {
    padding: 10,
  },
  title: {
    fontSize: "24px",
  },
}));
